import React from 'react';
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav style={{ padding: '10px', backgroundColor: '#0a74da', color: 'white' }}>
      <Link to="/" style={{ margin: 10, color: 'white' }}>Home</Link>
      <Link to="/upload" style={{ margin: 10, color: 'white' }}>Upload Record</Link>
      <Link to="/grant" style={{ margin: 10, color: 'white' }}>Grant Consent</Link>
      <Link to="/download" style={{ margin: 10, color: 'white' }}>Download Record</Link>
    </nav>
  );
}
